}

@mixin small-breakpoint-small-shadow-left ( $important:null ) {
	&.small, .small & { @media ( max-width: $breakpoint-small-min ) { 	box-shadow: -3px 0 3px 0 rgba( 0,0,0,.1) !important $important;} }
}

@mixin small-breakpoint-small-shadow-right ( $important:null ) {
	&.small, .small & { @media ( max-width: $breakpoint-small-min ) { 	box-shadow: 3px 0 3px 0 rgba( 0,0,0,.1) !important $important;} }
}

simple-button.css_string:
.small-breakpoint-small-simple-button { &.small, .small & { @media ( max-width: $breakpoint-small-min ) { 		&:hover { @include background-project-blue-lighter; }
	@include interactive;
	@include flex-center;
	@include font-size-large;
	@include background-project-blue-lightest;
} }
 }

simple-button.mixins_string:
@mixin small-breakpoint-small-simple-button ( $important:null ) {
	&.small, .small & { @media ( max-width: $breakpoint-small-min ) { 		&:hover { @include background-project-blue-lighter ( !important ); }
	@include interactive ( !important );
	@include flex-center ( !important );
	@include font-size-large ( !important );
	@include background-project-blue-lightest ( !important );
} }
}
